import React from 'react';
import ModalExample from "./modal";


const TableRow = ({soldier}) => {
    return (
        <tr>

            <td className="pa3 bb b--black-10">
                    {soldier.id}
                    <ModalExample/>
            </td>
            <td className="pa3 bb b--black-10">
                {soldier.first_name}
            </td>
            <td className="pa3 bb b--black-10">
                {soldier.last_name}
            </td>
            <td className="pa3 bb b--black-10">
                {soldier.milU}
            </td>
        </tr>
    )
}
export default TableRow;
